benefitAmountPercentageIncome.calculationRules:
{
  (function (parent, context, tables, rates) {
    var otherCoverageAmount = Big('0');
    var benefitType = parent.otherCoverageMonthlyBenefitType;
    var specifiedAmount = parent.otherCoverageSpecifiedAmount;
    var percentOfIncome = parent.otherCoveragePercentOfIncome;
    var monthlyCap = parent.otherCoveragePercentMonthlyCap;
    var annualIncome = parent.parent.parent.annualEarnedIncome;
    if (pmrl.isDefined(benefitType)) {
      if (pmrl.equal(benefitType, 'SPECIFIED_AMOUNT') && pmrl.isDefined(specifiedAmount)) {
        otherCoverageAmount = specifiedAmount;
      } else if (pmrl.equal(benefitType, 'PERCENT_OF_INCOME') && pmrl.isDefined(percentOfIncome) && pmrl.isDefined(annualIncome)) {
        var monthlyIncome = pmrl.div(annualIncome, Big('12'));
        otherCoverageAmount = pmrl.times(pmrl.div(percentOfIncome, Big('100')), monthlyIncome);
        if (pmrl.isDefined(monthlyCap) && pmrl.lessThan(monthlyCap, otherCoverageAmount)) {
          otherCoverageAmount = monthlyCap;
        }
      }
    }
    return otherCoverageAmount;
  });
}

