    var specialRestrictionEmployee = parent.parent.parent.parent.parent.additionalFields.specialRestrictionEmployee;
    if (pmrl.isDefined(parent.parent.parent.parent.parent.payors)) {
      isIndividualPaying = parent.parent.parent.parent.parent.payors[Big('0')].additionalFields.proposedInsuredInsuredThePayor;
    }
    var totalAmountToSubtract = Big('0');
    if (pmrl.isDefined(specialRestrictionEmployee) && pmrl.notEqual(specialRestrictionEmployee, 'STUDENT')) {
      for (var i = Big('0'); pmrl.lessThan(i, pmrl.length(otherCoverages)); i = pmrl.plus(i, Big('1'))) {
        var multiCoverageTypes = parent.parent.parent.parent.otherCoverages[i].coverageType;
        var multipleBenefitPercentageIncome = parent.parent.parent.parent.otherCoverages[i].additionalFields.benefitAmountPercentageIncome;
        if (pmrl.equal(multiCoverageTypes, 'INDIVIDUAL') || pmrl.equal(multiCoverageTypes, 'ASSOCIATION')) {
          totalAmountToSubtract = pmrl.plus(totalAmountToSubtract, multipleBenefitPercentageIncome);
        } else if (pmrl.equal(multiCoverageTypes, 'GROUP')) {
          groupPolicies = pmrl.plus(groupPolicies, Big('1'));
        }
      }
    }
    var SISAllowableBenefit = Big('0');
    if (pmrl.isDefined(specialRestrictionEmployee) && pmrl.notEqual(specialRestrictionEmployee, 'STUDENT')) {
      if (pmrl.equal(groupPolicies, Big('0'))) {
        if (pmrl.equal(selfEmployed, 'NO')) {
          if (pmrl.equal(isIndividualPaying, 'YES')) {
            startingTotalBenefit = pmrl.rangeLookup(tables, 'incomeQualSisTbl', {
              annualEarnedIncome
            }, 'sis');
          } else {
            startingTotalBenefit = pmrl.rangeLookup(tables, 'incomeErQualSisTbl', {
              annualEarnedIncome
            }, 'sis');
          }
        } else {
          if (pmrl.equal(isIndividualPaying, 'YES')) {
            startingTotalBenefit = pmrl.rangeLookup(tables, 'incomeSeQualSisTbl', {
              annualEarnedIncome
            }, 'sis');
          } else {
            startingTotalBenefit = pmrl.rangeLookup(tables, 'incomeErSeQualSisTbl', {
              annualEarnedIncome
            }, 'sis');
          }
        }
      }
    } else {
      startingTotalBenefit = Big('2600');
    }
    SISAllowableBenefit = pmrl.minus(startingTotalBenefit, totalAmountToSubtract);
    SISAllowableBenefit = pmrl.times(pmrl.round(pmrl.div(pmrl.minus(SISAllowableBenefit, Big('50')), Big('100')), Big('0')), Big('100'));
    if (pmrl.lessThan(SISAllowableBenefit, Big('0'))) {
      SISAllowableBenefit = Big('0');
    }
    return SISAllowableBenefit;
  });
}

