age.calculationRules:
{
  (function (parent, context, tables, rates) {
    var age = null;
    var birthDate = parent.parent.birthDate;
    if (pmrl.isDefined(birthDate)) {
      var relativeToDate = pmrl.dateNow();
      var birthDateIsLeapDay = pmrl.equal(pmrl.getMonth(birthDate), Big('2')) && pmrl.equal(pmrl.getDayOfMonth(birthDate), Big('29'));
      var relativeToYear = pmrl.getYear(relativeToDate);
      var relativeToLeapYear = pmrl.equal(pmrl.mod(relativeToYear, Big('4')), Big('0')) && (pmrl.notEqual(pmrl.mod(relativeToYear, Big('100')), Big('0')) || pmrl.equal(pmrl.mod(relativeToYear, Big('400')), Big('0')));
      var birthMonth = pmrl.getMonth(birthDate);
      var birthDayOfMonth = pmrl.getDayOfMonth(birthDate);
      if (birthDateIsLeapDay && !relativeToLeapYear) {
        birthMonth = Big('3');
        birthDayOfMonth = Big('1');
      }
      birthDate = pmrl.plusDays(pmrl.dateFromComponents(pmrl.getYear(birthDate), birthMonth, birthDayOfMonth, Big('0'), Big('0'), Big('0')), Big('1'));
      age = pmrl.minus(pmrl.getYear(relativeToDate), pmrl.getYear(birthDate));
      var monthDifference = pmrl.minus(pmrl.getMonth(relativeToDate), pmrl.getMonth(birthDate));
      var adjustment = Big('0');
      if (pmrl.lessThan(monthDifference, Big('0'))) {
        adjustment = pmrl.minus(Big('0'), Big('1'));
      } else if (pmrl.equal(monthDifference, Big('0'))) {
        var relativeToDateTimeWithinMonth = pmrl.plus(pmrl.plus(pmrl.plus(pmrl.times(pmrl.times(pmrl.times(pmrl.getDayOfMonth(relativeToDate), Big('24')), Big('60')), Big('60')), pmrl.times(pmrl.times(pmrl.getHours(relativeToDate), Big('60')), Big('60'))), pmrl.times(pmrl.getMinutes(relativeToDate), Big('60'))), pmrl.getSeconds(relativeToDate));
        var birthDateTimeWithinMonth = pmrl.plus(pmrl.plus(pmrl.plus(pmrl.times(pmrl.times(pmrl.times(pmrl.getDayOfMonth(birthDate), Big('24')), Big('60')), Big('60')), pmrl.times(pmrl.times(pmrl.getHours(birthDate), Big('60')), Big('60'))), pmrl.times(pmrl.getMinutes(birthDate), Big('60'))), pmrl.getSeconds(birthDate));
        if (pmrl.lessThanEqual(pmrl.minus(relativeToDateTimeWithinMonth, birthDateTimeWithinMonth), Big('0'))) {
          adjustment = pmrl.minus(Big('0'), Big('1'));
        }
      }
      age = pmrl.plus(age, adjustment);
    }
    return age;
  });
}

issueAge.calculationRules:
{
  (function (parent, context, tables, rates) {
    var age = null;
    var birthDate = parent.parent.birthDate;
    if (pmrl.isDefined(birthDate)) {
      var relativeToDate = pmrl.dateNow();
      if (pmrl.isDefined(parent.parent.applicationSignature) && pmrl.isDefined(parent.parent.applicationSignature.signatureTimestamp) && pmrl.greaterThan(pmrl.length(parent.parent.parent.sellingProducers), Big('0')) && pmrl.isDefined(parent.parent.parent.sellingProducers[Big('0')].applicationSignature.signatureTimestamp)) {
        if (pmrl.greaterThan(pmrl.getTime(parent.parent.applicationSignature.signatureTimestamp), pmrl.getTime(parent.parent.parent.sellingProducers[Big('0')].applicationSignature.signatureTimestamp))) {
          relativeToDate = parent.parent.applicationSignature.signatureTimestamp;
        } else {
          relativeToDate = parent.parent.parent.sellingProducers[Big('0')].applicationSignature.signatureTimestamp;
        }
        relativeToDate = pmrl.minusHours(pmrl.minusDays(relativeToDate, Big('30')), Big('12'));
      }
      var birthDateIsLeapDay = pmrl.equal(pmrl.getMonth(birthDate), Big('2')) && pmrl.equal(pmrl.getDayOfMonth(birthDate), Big('29'));
      var relativeToYear = pmrl.getYear(relativeToDate);
      var relativeToLeapYear = pmrl.equal(pmrl.mod(relativeToYear, Big('4')), Big('0')) && (pmrl.notEqual(pmrl.mod(relativeToYear, Big('100')), Big('0')) || pmrl.equal(pmrl.mod(relativeToYear, Big('400')), Big('0')));
      var birthMonth = pmrl.getMonth(birthDate);
      var birthDayOfMonth = pmrl.getDayOfMonth(birthDate);
      if (birthDateIsLeapDay && !relativeToLeapYear) {
        birthMonth = Big('3');
        birthDayOfMonth = Big('1');
      }
      birthDate = pmrl.plusDays(pmrl.dateFromComponents(pmrl.getYear(birthDate), birthMonth, birthDayOfMonth, Big('0'), Big('0'), Big('0')), Big('1'));
      age = pmrl.minus(pmrl.getYear(relativeToDate), pmrl.getYear(birthDate));
      var monthDifference = pmrl.minus(pmrl.getMonth(relativeToDate), pmrl.getMonth(birthDate));
      var adjustment = Big('0');
      if (pmrl.lessThan(monthDifference, Big('0'))) {
        adjustment = pmrl.minus(Big('0'), Big('1'));
      } else if (pmrl.equal(monthDifference, Big('0'))) {
        var relativeToDateTimeWithinMonth = pmrl.plus(pmrl.plus(pmrl.plus(pmrl.times(pmrl.times(pmrl.times(pmrl.getDayOfMonth(relativeToDate), Big('24')), Big('60')), Big('60')), pmrl.times(pmrl.times(pmrl.getHours(relativeToDate), Big('60')), Big('60'))), pmrl.times(pmrl.getMinutes(relativeToDate), Big('60'))), pmrl.getSeconds(relativeToDate));
        var birthDateTimeWithinMonth = pmrl.plus(pmrl.plus(pmrl.plus(pmrl.times(pmrl.times(pmrl.times(pmrl.getDayOfMonth(birthDate), Big('24')), Big('60')), Big('60')), pmrl.times(pmrl.times(pmrl.getHours(birthDate), Big('60')), Big('60'))), pmrl.times(pmrl.getMinutes(birthDate), Big('60'))), pmrl.getSeconds(birthDate));
        if (pmrl.lessThanEqual(pmrl.minus(relativeToDateTimeWithinMonth, birthDateTimeWithinMonth), Big('0'))) {
          adjustment = pmrl.minus(Big('0'), Big('1'));
        }
      }
      var ageBeforeAdjustment = age;
      age = pmrl.plus(age, adjustment);
      if (pmrl.equal(ageBeforeAdjustment, Big('18')) && pmrl.equal(age, Big('17'))) {
        age = Big('18');
      }
    }
    return age;
  });
}

