      var associationDiscount = Big('0');
      var multiLifeDiscount = Big('0');
      var multiPolicyDiscount = Big('0');
      var selfEmployedDiscount = Big('0');
      var spouseDiscount = Big('0');
      var commonEmployerDiscount = Big('0');
      var DECIMAL_PLACES_TO_ROUND = Big('2');
      var MINIMUM_PREMIUM_AMOUNT = Big('.01');
      var SELECTED_YES = 'YES';
      if (pmrl.equal(parent.parent.discountAssociationGroup, SELECTED_YES)) {
        associationDiscount = Big('0.15');
      }
      var associationDiscountValue = pmrl.minus(Big('1'), associationDiscount);
      if (pmrl.equal(parent.parent.additionalFields.programsMultiLife, SELECTED_YES)) {
        multiLifeDiscount = Big('0.20');
      }
      var multiLifeDiscountValue = pmrl.minus(Big('1'), multiLifeDiscount);
      if (pmrl.equal(parent.parent.discountMultiPolicy, SELECTED_YES)) {
        multiPolicyDiscount = Big('0.10');
      }
      var multiPolicyDiscountValue = pmrl.minus(Big('1'), multiPolicyDiscount);
      if (pmrl.equal(parent.parent.discountSelfEmployed, SELECTED_YES)) {
        selfEmployedDiscount = Big('0.15');
      }
      var selfEmployedDiscountValue = pmrl.minus(Big('1'), selfEmployedDiscount);
      if (pmrl.equal(parent.parent.discountHousehold, SELECTED_YES)) {
        spouseDiscount = Big('0.10');
