      var spouseDiscountValue = pmrl.minus(Big('1'), spouseDiscount);
      if (pmrl.equal(parent.parent.discountCommonEmployer, SELECTED_YES)) {
        commonEmployerDiscount = Big('0.15');
      }
      var commonEmployerDiscountValue = pmrl.minus(Big('1'), commonEmployerDiscount);
      finalDiscountPercent = pmrl.round(pmrl.max(pmrl.times(pmrl.times(pmrl.times(pmrl.times(pmrl.times(associationDiscountValue, multiLifeDiscountValue), multiPolicyDiscountValue), selfEmployedDiscountValue), spouseDiscountValue), commonEmployerDiscountValue), Big('0.7')), Big('5'));
